import Navbar from './Components/Navbar/Navbar';
import Main from './Pages/Main';
import './index.css';
import React from 'react';

import axios from 'axios';
function App() {
  // axios.post('https://localhost:5000/getItems').then((data) => {
  //   console.log(data);
  // });

  React.useEffect(() => {
    async function fetchData() {
      try {
        const itemResponse = await Promise.all([axios.get('localhost:5000/getItems')]);

        console.log(itemResponse.data);
      } catch (error) {
        console.log(error);
      }
    }
    fetchData();
  }, []);
  return (
    <div className="wrapper">
      <Navbar />
      <Main />
    </div>
  );
}

export default App;
